let initialState = [];

const ExampleReducer = (state = initialState, action) => {
    switch (action.type) {
        // Typ der Action
        case "GET_CONFIG":
            console.log("Payload: ", action.payload)
            return [...action.payload];
        default:
            return state;
    }
}
export default ExampleReducer;
